### Summary of Core Topics, Concepts, Principles, and Equations

#### Database Management Systems (DBMS)

1. **SQL Queries and Operations**
   - **SELECT Statement**: Used to retrieve data from a database.
     ```sql
     SELECT column1, column2 FROM table_name WHERE condition;
     ```
   - **GROUP BY Clause**: Groups rows that have the same values in specified columns.
     ```sql
     SELECT column1, COUNT(*)
     FROM table_name
     GROUP BY column1;
     ```
   - **ORDER BY Clause**: Sorts the result set in ascending or descending order.
     ```sql
     SELECT column1, column2
     FROM table_name
     ORDER BY column1 ASC|DESC;
     ```
   - **JOIN Operations**: Combines rows from two or more tables based on a related column.
     ```sql
     SELECT column1, column2
     FROM table1
     JOIN table2 ON table1.column = table2.column;
     ```
   - **EXISTS Clause**: Used to test for the existence of rows in a subquery.
     ```sql
     SELECT column1
     FROM table1
     WHERE EXISTS (SELECT 1 FROM table2 WHERE table1.column = table2.column);
     ```
   - **ALL Keyword**: Used to compare a value to all values in another set of values.
     ```sql
     SELECT column1
     FROM table1
     WHERE column1 > ALL (SELECT column2 FROM table2);
     ```

2. **Relational Algebra**
   - **Selection (σ)**: Selects tuples that satisfy a given predicate.
     ```latex
     \sigma_{condition}(Relation)
     ```
   - **Projection (π)**: Projects a relation over a set of attributes.
     ```latex
     \Pi_{attributes}(Relation)
     ```
   - **Join (⋈)**: Combines two relations based on a common attribute.
     ```latex
     Relation1 \bowtie Relation2
     ```
   - **Cartesian Product (×)**: Combines two relations by concatenating each tuple of the first relation with each tuple of the second relation.
     ```latex
     Relation1 \times Relation2
     ```

3. **Entity-Relationship (E-R) Diagrams**
   - **Entities**: Represent real-world objects.
   - **Attributes**: Describe properties of entities.
   - **Relationships**: Define how entities are related to each other.
   - **Primary Key**: Uniquely identifies each entity instance.
   - **Foreign Key**: References the primary key of another entity to establish relationships.

4. **Integrity Constraints**
   - **Primary Key Constraint**: Ensures that the primary key uniquely identifies each row in a table.
   - **Foreign Key Constraint**: Ensures that the foreign key values match the primary key values in the referenced table.
   - **Check Constraint**: Ensures that the values in a column meet a specific condition.
     ```sql
     CREATE TABLE table_name (
         column1 data_type CHECK (condition)
     );
     ```
   - **ON DELETE CASCADE**: Automatically deletes the rows in the child table when the referenced row in the parent table is deleted.

5. **Database Schema and Design**
   - **Relational Schema**: Defines the structure of a relational database, including tables, columns, and relationships.
   - **Normalization**: Process of organizing data to minimize redundancy and dependency.

